'''Óswine''' was the father of [[Éadwine]] and thus a grandfather of [[Ælfwine]] the Mariner.<ref>{{SD|2d}}, p. 270</ref>

== Etymology ==
The name ''Óswine'' is in [[Old English]]. It contains the elements ''os'' ("god")  + ''wine'' ("friend").<ref>{{webcite|website=Behind the Name|articlename=Oswin|articleurl=http://www.behindthename.com/name/oswin}}</ref>

